import React from 'react';
import Nav from './Components/Nav/Nav';
import Cuerpo from './Components/Cuerpo/Cuerpo';
import HeroWindow from './Components/HeroWindow/HeroWindow';
import CardBody from './Components/CardBody/CardBody';

import BodyCard from './Components/BodyCard/BodyCard';
import CallTo from './Components/CallTo/CallTo';
import './App.css';


class App extends React.Component{
  constructor(props){
    super(props);
    this.state = {
      submit: ''
    }
  }

  render(){

    const gretting = 'Hablemos';
    const estiloButton = 'br4-ns br3 ba color-boton ttu center pt2 pb2 pr4 pl4 f4 f2-ns no-underline grow';

    return(

      <div>
          <Nav gretting={gretting} estiloButton={estiloButton}/>
          <HeroWindow gretting={gretting} estiloButton={estiloButton}/>
          <Cuerpo />
          <CardBody />
          <BodyCard />
          <CallTo gretting={gretting} estiloButton={estiloButton}/>


      </div>

    );
  }



}

export default App;
